  parameter MAX_ERROR_COUNT = 2324; //uint32


 // Signals
  reg  i_clk; // boolean
  reg  i_clk_enable; // boolean
  reg  i_reset; // boolean
  reg  signed [15:0] i_filter_data; // sfix16_En15
  wire signed [31:0] o_filter_data; // sfix32_En26

  reg  tb_enb; // boolean
  wire srcDone; // boolean
  wire snkDone; // boolean
  wire testFailure; // boolean
  reg  tbenb_dly; // boolean
  reg  [3:0] counter; // ufix4
  wire phase_1; // boolean
  wire rdEnb_phase_1; // boolean
  wire i_filter_data_data_log_rdenb; // boolean
  reg  [11:0] i_filter_data_data_log_addr; // ufix12
  reg  i_filter_data_data_log_done; // boolean
  reg  signed [15:0] holdData_i_filter_data; // sfix16_En15
  reg  o_filter_data_testFailure; // boolean
  integer o_filter_data_errCnt; // uint32
  wire delayLine_out; // boolean
  wire expected_ce_out; // boolean
  reg  int_delay_pipe [0:23] ; // boolean
  wire o_filter_data_rdenb; // boolean
  reg  [11:0] o_filter_data_addr; // ufix12
  reg  o_filter_data_done; // boolean
  wire signed [31:0] o_filter_data_ref; // sfix32_En26
  wire signed [31:0] o_filter_data_dataTable; // sfix32_En26
  wire signed [31:0] o_filter_data_refTmp; // sfix32_En26
  reg  signed [31:0] regout; // sfix32_En26
  reg  check1_Done; // boolean

 // Module Instances
  IIR_filter u_IIR_filter
    (
    .i_clk(i_clk),
    .i_clk_enable(i_clk_enable),
    .i_reset(i_reset),
    .i_filter_data(i_filter_data),
    .o_filter_data(o_filter_data)
    );


 // Block Statements
  // -------------------------------------------------------------
  // Driving the test bench enable
  // -------------------------------------------------------------

  always @(i_reset, snkDone)
  begin
    if (i_reset == 1'b0)
      tb_enb <= 1'b0;
    else if (snkDone == 1'b0 )
      tb_enb <= 1'b1;
    else begin
    # (i_clk_period * 2);
      tb_enb <= 1'b0;
    end
  end

  always @(posedge i_clk or negedge i_reset) // completed_msg
  begin
    if (~i_reset) begin 
       // Nothing to reset.
    end 
    else begin 
      if (snkDone == 1) begin
        if (testFailure == 0)
              $display("**************TEST COMPLETED (PASSED)**************");
        else
              $display("**************TEST COMPLETED (FAILED)**************");
      end
    end
  end // completed_msg;

  // -------------------------------------------------------------
  // System Clock (fast clock) and reset
  // -------------------------------------------------------------

  always  // clock generation
  begin // i_clk_gen
    i_clk <= 1'b1;
    # i_clk_high;
    i_clk <= 1'b0;
    # i_clk_low;
    if (snkDone == 1) begin
      i_clk <= 1'b1;
      # i_clk_high;
      i_clk <= 1'b0;
      # i_clk_low;
      $stop;
    end
  end  // i_clk_gen

  initial  // reset block
  begin // i_reset_gen
    i_reset <= 1'b0;
    # (i_clk_period * 2);
    @ (posedge i_clk);
    # (i_clk_hold);
    i_reset <= 1'b1;
  end  // i_reset_gen

  // -------------------------------------------------------------
  // Testbench clock enable
  // -------------------------------------------------------------

  always @ (posedge i_clk or negedge i_reset)
    begin: tb_enb_delay
      if (i_reset == 1'b0) begin
        tbenb_dly <= 1'b0;
      end
      else begin
        if (tb_enb == 1'b1) begin
          tbenb_dly <= tb_enb;
        end
      end
    end // tb_enb_delay

  // -------------------------------------------------------------
  // Slow Clock (clkenb)
  // -------------------------------------------------------------

  always @ (posedge i_clk or negedge i_reset)
    begin: slow_clock_enable
      if (i_reset == 1'b0) begin
        counter <= 4'b0001;
      end
      else begin
        if (tbenb_dly == 1'b1) begin
          if (counter >= 4'b1011) begin
            counter <= 4'b0000;
          end
          else begin
            counter <= counter + 4'b0001;
          end
        end
      end
    end // slow_clock_enable

  assign  phase_1 = (counter == 4'b0001 && tbenb_dly == 1'b1) ? 1'b1 : 1'b0;

      assign rdEnb_phase_1 = phase_1;

  // -------------------------------------------------------------
  // Read the data and transmit it to the DUT
  // -------------------------------------------------------------

  always @(posedge i_clk or negedge i_reset)
  begin
    i_filter_data_data_log_task(i_clk,i_reset,
                                i_filter_data_data_log_rdenb,i_filter_data_data_log_addr,
                                i_filter_data_data_log_done);
  end

  assign i_filter_data_data_log_rdenb = rdEnb_phase_1;

  always @ (posedge i_clk or negedge i_reset)
  begin // stimuli_i_filter_data_data_log_i_filter_data_reg
    if (~i_reset) begin 
      holdData_i_filter_data <=  16'bx;
    end
    else begin
      holdData_i_filter_data <= i_filter_data_data_log_force[i_filter_data_data_log_addr];
    end
  end

  always @ (i_filter_data_data_log_rdenb, i_filter_data_data_log_addr)
  begin // stimuli_i_filter_data_data_log_i_filter_data
    if (i_filter_data_data_log_rdenb == 1) begin
      i_filter_data <= # i_clk_hold i_filter_data_data_log_force[i_filter_data_data_log_addr];
    end
    else begin 
      i_filter_data <= # i_clk_hold holdData_i_filter_data;
    end
  end // stimuli_i_filter_data_data_log_i_filter_data

  // -------------------------------------------------------------
  // Create done signal for Input data
  // -------------------------------------------------------------

  assign srcDone = i_filter_data_data_log_done;


  always @( posedge i_clk or negedge i_reset)
    begin: ceout_delayLine
      if (i_reset == 1'b0) begin
        int_delay_pipe[0] <= 1'b0;
        int_delay_pipe[1] <= 1'b0;
        int_delay_pipe[2] <= 1'b0;
        int_delay_pipe[3] <= 1'b0;
        int_delay_pipe[4] <= 1'b0;
        int_delay_pipe[5] <= 1'b0;
        int_delay_pipe[6] <= 1'b0;
        int_delay_pipe[7] <= 1'b0;
        int_delay_pipe[8] <= 1'b0;
        int_delay_pipe[9] <= 1'b0;
        int_delay_pipe[10] <= 1'b0;
        int_delay_pipe[11] <= 1'b0;
        int_delay_pipe[12] <= 1'b0;
        int_delay_pipe[13] <= 1'b0;
        int_delay_pipe[14] <= 1'b0;
        int_delay_pipe[15] <= 1'b0;
        int_delay_pipe[16] <= 1'b0;
        int_delay_pipe[17] <= 1'b0;
        int_delay_pipe[18] <= 1'b0;
        int_delay_pipe[19] <= 1'b0;
        int_delay_pipe[20] <= 1'b0;
        int_delay_pipe[21] <= 1'b0;
        int_delay_pipe[22] <= 1'b0;
        int_delay_pipe[23] <= 1'b0;
      end
      else begin
        if (i_clk_enable == 1'b1) begin
        int_delay_pipe[0] <= rdEnb_phase_1;
        int_delay_pipe[1] <= int_delay_pipe[0];
        int_delay_pipe[2] <= int_delay_pipe[1];
        int_delay_pipe[3] <= int_delay_pipe[2];
        int_delay_pipe[4] <= int_delay_pipe[3];
        int_delay_pipe[5] <= int_delay_pipe[4];
        int_delay_pipe[6] <= int_delay_pipe[5];
        int_delay_pipe[7] <= int_delay_pipe[6];
        int_delay_pipe[8] <= int_delay_pipe[7];
        int_delay_pipe[9] <= int_delay_pipe[8];
        int_delay_pipe[10] <= int_delay_pipe[9];
        int_delay_pipe[11] <= int_delay_pipe[10];
        int_delay_pipe[12] <= int_delay_pipe[11];
        int_delay_pipe[13] <= int_delay_pipe[12];
        int_delay_pipe[14] <= int_delay_pipe[13];
        int_delay_pipe[15] <= int_delay_pipe[14];
        int_delay_pipe[16] <= int_delay_pipe[15];
        int_delay_pipe[17] <= int_delay_pipe[16];
        int_delay_pipe[18] <= int_delay_pipe[17];
        int_delay_pipe[19] <= int_delay_pipe[18];
        int_delay_pipe[20] <= int_delay_pipe[19];
        int_delay_pipe[21] <= int_delay_pipe[20];
        int_delay_pipe[22] <= int_delay_pipe[21];
        int_delay_pipe[23] <= int_delay_pipe[22];
        end
      end
    end // ceout_delayLine

  assign delayLine_out = int_delay_pipe[23];

  assign expected_ce_out =  delayLine_out & i_clk_enable;

  // -------------------------------------------------------------
  //  Checker: Checking the data received from the DUT.
  // -------------------------------------------------------------

  always @(posedge i_clk or negedge i_reset)
  begin
    o_filter_data_task(i_clk,i_reset,
                       o_filter_data_rdenb,o_filter_data_addr,
                       o_filter_data_done);
  end

  assign o_filter_data_rdenb = expected_ce_out;

  assign # i_clk_hold o_filter_data_dataTable = o_filter_data_expected[o_filter_data_addr];

// ---- Bypass Register ----
  always @ (posedge i_clk or negedge i_reset)
    begin: DataHoldRegister_temp_process2
      if (i_reset == 1'b0) begin
        regout <= 0;
      end
      else begin
        if (expected_ce_out == 1'b1) begin
          regout <= o_filter_data_dataTable;
        end
      end
    end // DataHoldRegister_temp_process2

  assign o_filter_data_refTmp = (expected_ce_out == 1'b1) ? o_filter_data_dataTable :
                          regout;


  assign o_filter_data_ref = o_filter_data_refTmp;



  always @ (posedge i_clk or negedge i_reset) // checker_o_filter_data
  begin
    if (i_reset == 0) begin
      o_filter_data_testFailure <= 0;
      o_filter_data_errCnt <= 0;
    end 
    else begin 
      if (o_filter_data_rdenb == 1 ) begin 
        if (o_filter_data !== o_filter_data_expected[o_filter_data_addr]) begin
           o_filter_data_errCnt <= o_filter_data_errCnt + 1;
           o_filter_data_testFailure <= 1;
               $display("ERROR in o_filter_data at time %t : Expected '%h' Actual '%h'", 
                    $time, o_filter_data_expected[o_filter_data_addr], o_filter_data);
           if (o_filter_data_errCnt >= MAX_ERROR_COUNT) 
             $display("Warning: Number of errors for o_filter_data have exceeded the maximum error limit");
        end

      end
    end
  end // checker_o_filter_data

  always @ (posedge i_clk or negedge i_reset) // checkDone_1
  begin
    if (i_reset == 0)
      check1_Done <= 0;
    else if ((check1_Done == 0) && (o_filter_data_done == 1) && (o_filter_data_rdenb == 1))
      check1_Done <= 1;
  end

  // -------------------------------------------------------------
  // Create done and test failure signal for output data
  // -------------------------------------------------------------

  assign snkDone = check1_Done;

  assign testFailure = o_filter_data_testFailure;

  // -------------------------------------------------------------
  // Global clock enable
  // -------------------------------------------------------------
  always @(snkDone, tbenb_dly)
  begin
    if (snkDone == 0)
      # i_clk_hold i_clk_enable <= tbenb_dly;
    else
      # i_clk_hold i_clk_enable <= 0;
  end

 // Assignment Statements



endmodule // filter_tb
